import './App.css'
import Login from './components/signin/signin'
import TopMovies from './components/top-movies/top-movies'
import Navbar from './components/navbar/navbar';
import SingleMovie from './components/single-movie/single-movie';
import SingleStar from './components/single-star/single-star';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
	<div className="App">
		<Navbar/>
		<div className="content">
			<Routes>
				<Route path="/login" component={<Login/>}/>
			</Routes>
			<Routes>
				<Route path="/top-movies" component={<TopMovies/>}/>
			</Routes>
			<Routes>
				<Route path="/single-movie" component={<SingleMovie/>}/>
			</Routes>
			<Routes>
				<Route path="/single-star" component={<SingleStar/>}/>
			</Routes>
		</div>
	</div>
  );
}

export default App;
